import React from 'react';

import {Section, Image} from './HomeElements';
import homepage from '../../images/homepage.jpg';

const Home = () => {
    return (
        <Section>
            <h1>Hello</h1>
            <Image src={homepage} alt='snowy mountains'/>
        </Section>
    );
};

export default Home;
